-- TC what is PK?   should we link to Schein saver?   handle ISR vs FSC camp?   like to PO campaign?
CREATE TABLE [pbi].[Campaign_Product_Lists](
	-- match BRS_Item	
	[ItemNumber] [char](10) NOT NULL,
--	[ItemNumber] [int] NOT NULL,

	[CampaignGroup] [nvarchar](50) NOT NULL,
	[CampaignName] [nvarchar](50) NOT NULL,

	-- match BRS_Promo
	[PromoCode] [char](2) NOT NULL,
--	[PromoCode] [nvarchar](50) NOT NULL,

	[StartDate] [date] NOT NULL,
	[EndDate] [date] NOT NULL

	-- synthetic key for quick lookups
	,ID [int] identity(1,1) NOT NULL
) ON [USERDATA]
GO

BEGIN TRANSACTION
GO
ALTER TABLE pbi.Campaign_Product_Lists ADD CONSTRAINT
	PK_Campaign_Product_Lists PRIMARY KEY CLUSTERED 
	(
	ID
	) WITH( STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON) ON USERDATA

GO
ALTER TABLE pbi.Campaign_Product_Lists SET (LOCK_ESCALATION = TABLE)
GO
COMMIT

-- RI
BEGIN TRANSACTION
GO
ALTER TABLE pbi.Campaign_Product_Lists ADD CONSTRAINT
	FK_Campaign_Product_Lists_BRS_Item FOREIGN KEY
	(
	ItemNumber
	) REFERENCES dbo.BRS_Item
	(
	Item
	) ON UPDATE  NO ACTION 
	 ON DELETE  NO ACTION 
	
GO
ALTER TABLE pbi.Campaign_Product_Lists ADD CONSTRAINT
	FK_Campaign_Product_Lists_BRS_Promotion FOREIGN KEY
	(
	PromoCode
	) REFERENCES dbo.BRS_Promotion
	(
	PromotionCode
	) ON UPDATE  NO ACTION 
	 ON DELETE  NO ACTION 
	
GO
ALTER TABLE pbi.Campaign_Product_Lists SET (LOCK_ESCALATION = TABLE)
GO
COMMIT

